// Routings.js - Module
import React from 'react';

//Component_Nesting_into_Routings
import Header from './MainMenu/Header.js';
import Footer from './MainMenu/Footer.js';
import Home from './MainMenu/Home.js';
import About from './MainMenu/About.js';
import Services from './MainMenu/Services.js';
import Contact from './MainMenu/Contact.js';
import Pagenotfound from './Pagenotfound.js';


//Routings_Package
import { BrowserRouter, Route, Link, Sw} from 'react-router-dom';

//Routings_setup
function Routings() 
{

    return (
    <BrowserRouter>

  
        {/* Navbar Links  */}
           <Header />
        {/* Navbar Links */}

   <Switch>

        {/*<Home /> */}
        <Route exact path="/" component={Home} />

        <Route path="/home" component={Home} />

        {/*<About /> */}
        <Route path="/about" component={About} />

         {/*<Services /> */}
         <Route path="/services" component={Services} />

         {/*<Contact /> */}
         <Route path="/contact" component={Contact} />

         {/*<Contact /> */}
         <Route component={Pagenotfound} />
    </Switch>     
        {/* Footer Section  */}
        <Footer />
        {/* Footer Section */}

      </BrowserRouter>
      )
}
export default Routings;
